import React, { useState } from "react"
import firebase from "../../firebase/firebase"

export const Profesionales = () => {
    const [profesional, setProfesional] = useState({ name: "" })
    console.log(profesional)


    const handleSubmit = async () => {
        await firebase.db.collection("profesionales").add(profesional)
        alert("guardado")
    }


    const handleChange = (e) => {
        setProfesional({ name: e.target.value })
    }
    return <div className="w-75 m-auto">
        <form onSubmit={handleSubmit}>
            <div className="input-group mb-3">
                <input type="text" onChange={handleChange} className="form-control" placeholder="Agregue un profesional" aria-label="Default" aria-describedby="inputGroup-sizing-default" />

            </div>
        </form>
    </div>
}
